export default {
  props: ['name'],
  computed: {
    position: function position() {
      var pos = this.$store.getters.mostRecentMeasurement(this.name);
      console.log("pos", pos);

      if (pos.value && pos.value.length > 1) {
        return {
          lat: pos.value[0],
          lng: pos.value[1]
        };
      }

      return false;
    }
  }
};
